import React from "react";
import "./Navbar.module.scss"
import pepe from "./Navbar.module.scss"



const Navbar = () => {
    return (
        <nav className="nav">
            <p 
            className={`${pepe.prueba} d-flex flex-sm-row flex-column align-items-center justify-content-center gap-4 mb-5`}>
                Navbar
            </p>
        </nav>
    );
}

export default Navbar;
